class Solution(object):
    def countSubMultisets(self, nums, l, r):
        from collections import Counter
        mod = 10**9 + 7
        dp = [0] * (r + 1)
        dp[0] = 1  # Base case: empty subset always has sum 0

        for num in nums:
            for i in range(r, num - 1, -1):
                dp[i] = (dp[i] + dp[i - num]) % mod

        # Count the number of subsets with sum in the range [0, l-1] to subtract from the total
        dp_less_than_l = [0] * (l)
        dp_less_than_l[0] = 1  # Base case

        for num in nums:
            for i in range(l - 1, num - 1, -1):
                dp_less_than_l[i] = (dp_less_than_l[i] + dp_less_than_l[i - num]) % mod

        return (sum(dp[l:]) - sum(dp_less_than_l[:l]) + mod) % mod
